your transmission is not working well and you notice changes in the way it sounds when you shift gears, or if shifting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates.\"}]', 1, 80.00, 200.00, 80.00, 1, '[{\"name\":\"Child Toddler Seat\",\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Infant Child Seat\",\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"GPS Satellite\",\"price\":\"200\",\"type\":\"one_time\"}]', 6, 2, '18m', '31km/h', '{\"0\":{\"title\":\"Manufacturer\",\"content\":\"Sunrise\"},\"1\":{\"title\":\"Boat skipper\",\"content\":\"Bareboat\"},\"2\":{\"title\":\"Model\",\"content\":\"Summer Breeze\"},\"3\":{\"title\":\"Year\",\"content\":\"2010\"},\"4\":{\"title\":\"Number of crew\",\"content\":\"5\"},\"5\":{\"title\":\"Engines\",\"content\":\"Diesel\"},\"6\":{\"title\":\"Fuel\",\"content\":\"Composite\"}}', 'Full refund up to 4 days prior.', '<p>For Sanitary purposes ONLY, although there is a working toilet and shower, we\'ve deactivated the shower and the toliet is for limited use (urine only..pardon the graphic detail!). This keeps the boat clean and odor-free for all of our guests.&nbsp; Sinks can be used.</p>\r\n<p>Booking is weather pending. Because of the safety factors associated with the boat and inclement weather, If forecast shows rain, strong winds etc, the Host will communicate with Guest 24-48hrs in advance to mutually cancel/reschedule reservation. No smoking in boat cabin.</p>', 4.3, 'publish', 1, NULL, NULL, NULL, 6, NULL, NULL, '2024-01-20 00:32:11', '2024-01-20 00:32:13', 6, NULL, NULL, NULL, NULL),
