(1, 'Room Kerama Islands', 'Room Sheraton comprises of 1 Double Bed or 2 Twin Beds, 2 Bedside Tables, a Desk & Chair. The room is furnished with wall to wall carpeting, trendy furnishings and a balcony.Our ultramodern glass bathroom is equipped with hairdryer, magnifying shaving and make up mirror as well as all the amenities you could possible need during your stay.A Complimentary Bottle of Wine, Fresh Fruit and Mineral Water, are provided on arrival. Electric current: 220 Volts. Smoking rooms & inter-connecting rooms are also available.', 67, '329,330,331,332,333,334,335,336,337,338,339,340', 'https://www.youtube.com/watch?v=bhOiLfkChPo', 350.00, 1, 5, 5, 200, 10, 4, 'publish', 1, NULL, NULL, '2024-01-20 00:31:59', NULL, NULL, NULL),
